    .ivu-mt {
        display: flex;
        justify-content: space-between;
    }

    .iconfont-diy {
        font-size: 24px;
        color: #1890ff;
    }

    .diy-wrapper {
        max-width: 100%;
        min-width: 1100px;
        display: flex;
        justify-content: space-between;
        /*height: 84.5vh;*/

        .left {
            min-width: 300px;
            max-width: 300px;
            /* border 1px solid #DDDDDD */
            border-radius: 4px;
            height: 100%;

            .title-bar {
                display: flex;
                color: #333;
                border-bottom: 1px solid #eee;
                border-radius: 4px;
                cursor: pointer;

                .title-item {
                    display: flex;
                    align-items: center;
                    justify-content: center;
                    flex: 1;
                    height: 45px;

                    &.on {
                        color: #1890FF;
                        font-size: 14px;
                        border-bottom: 1px solid #1890FF;
                    }
                }
            }

            .wrapper {
                padding: 15px;
                overflow-y: scroll;
                -webkit-overflow-scrolling: touch;

                .tips {
                    display: flex;
                    justify-content: space-between;
                    padding-bottom: 15px;
                    font-size: 13px;
                    color: #000;
                    cursor: pointer;

                    .ivu-icon {
                        color: #000;
                    }
                }
            }

            .link-item {
                padding: 10px;
                border-bottom: 1px solid #F5F5F5;
                font-size: 12px;
                color: #323232;

                .name {
                    font-size: 14px;
                    color: #1890FF;
                }

                .link-txt {
                    margin-top: 2px;
                    word-break: break-all;
                }

                .params {
                    margin-top: 5px;
                    color: #1CBE6B;
                    word-break: break-all;

                    .txt {
                        color: #323232;
                    }

                    span {
                        &:last-child i {
                            display: none;
                            color: red;
                        }
                    }
                }

                .lable {
                    display: flex;
                    margin-top: 5px;
                    color: #999;

                    p {
                        flex: 1;
                        word-break: break-all;
                    }

                    button {
                        margin-left: 30px;
                        width: 38px;
                    }
                }
            }

            .dragArea.list-group {
                display: flex;
                flex-wrap: wrap;

                .list-group-item {
                    display: flex;
                    flex-direction: column;
                    align-items: center;
                    justify-content: center;
                    width: 74px;
                    height: 66px;
                    margin-right: 17px;
                    margin-bottom: 10px;
                    font-size: 12px;
                    color: #666;
                    cursor: pointer;
                    border-radius: 5px;
                    text-align center;

                    &:hover {
                        box-shadow: 0 0 5px 0 rgba(24, 144, 255, 0.3);
                        border-right: 5px;
                    }

                    &:nth-child(3n) {
                        margin-right: 0;
                    }
                }
            }
        }

        .content {
            position: relative;
            height: 100%;
            width 100%;

            .page-foot {
                position: relative;
                width 379px;
                margin 0 auto 20px auto;

                .delete-box {
                    display: none;
                    position: absolute;
                    left: -2px;
                    top: 0;
                    width: 383px;
                    height: 100%;
                    border: 2px dashed #1890ff;
                    padding: 10px 0;
                }

                &:hover, &.on {
                    /*cursor: move;*/

                    .delete-box {
                        /*display: block;*/
                    }
                }

                &.on {
                    cursor: move;
                    .delete-box {
                        display: block;
                        border: 2px solid #1890ff;
                        box-shadow: 0 0 10px 0 rgba(24, 144, 255, 0.3);
                    }
                }


            }

            .page-title {
                position: relative;
                height: 35px;
                line-height: 35px;
                background: #fff;
                font-size: 15px;
                color: #333333;
                text-align: center;
                width 379px;
                margin 0 auto;

                .delete-box {
                    display: none;
                    position: absolute;
                    left: -2px;
                    top: 0;
                    width: 383px;
                    height: 100%;
                    border: 2px dashed #1890ff;
                    padding: 10px 0;

                    span {
                        position: absolute;
                        right: 0;
                        bottom: 0;
                        width: 32px;
                        height: 16px;
                        line-height: 16px;
                        display: inline-block;
                        text-align: center;
                        font-size: 10px;
                        color: #fff;
                        background: rgba(0, 0, 0, 0.4);
                        margin-left: 2px;
                        cursor: pointer;
                        z-index: 11;
                    }
                }

                &:hover, &.on {
                    /*cursor: move;*/

                    .delete-box {
                        /*display: block;*/
                    }
                }

                &.on {
                    cursor: move;
                    .delete-box {
                        display: block;
                        border: 2px solid #1890ff;
                        box-shadow: 0 0 10px 0 rgba(24, 144, 255, 0.3);
                    }
                }

            }

            .scroll-box {
                flex: 1;
                background-color: #fff;
                width 379px;
                margin 0 auto;
                padding-top 1px;
            }

            .dragArea.list-group {
                width: 100%;
                height 100%;

                .mConfig-item {
                    position: relative;
                    cursor move;

                    .delete-box {
                        display: none;
                        position: absolute;
                        left: -2px;
                        top: 0;
                        width: 383px;
                        height: 100%;
                        border: 2px dashed #1890ff;
                        /*padding: 10px 0;*/

                        .handleType{
                            position: absolute;
                            right: -43px;
                            top: 0;
                            width: 36px;
                            height: 143px;
                            border-radius 4px;
                            background-color #1890ff;
                            cursor pointer;
                            color #fff;
                            font-weight bold;
                            text-align center;
                            padding 4px 0;

                            .iconfont {
                                padding 5px 0;
                                &.on{
                                    opacity 0.4
                                }
                            }
                        }
                    }
                    &.on {
                        cursor: move;
                        .delete-box {
                            display: block;
                            border: 2px solid #1890ff;
                            box-shadow: 0 0 10px 0 rgba(24, 144, 255, 0.3);
                        }
                    }

                }
            }
        }

        .right-box {
            max-width: 400px;
            min-width: 400px;
            height: 100%;
            border-radius: 4px;
            overflow: scroll;
            -webkit-overflow-scrolling: touch;

            .title-bar {
                width: 100%;
                height: 45px;
                line-height: 45px;
                padding-left: 24px;
                color: #000;
                border-radius: 4px;
                border-bottom: 1px solid #eee;
                font-size: 14px;
            }
        }

        ::-webkit-scrollbar {
            width: 6px;
            background-color: transparent;
        }

        ::-webkit-scrollbar-track {
            border-radius: 10px;
        }

        ::-webkit-scrollbar-thumb {
            background-color: #bfc1c4;
        }
    }

    .foot-box {
        position: relative;
        display: flex;
        align-items: center;
        justify-content: center;
        height: 80px;
        background: #fff;
        box-shadow: 0px -2px 4px 0px rgba(0, 0, 0, 0.03);

        button {
            width: 100px;
            height: 32px;
            font-size: 13px;

            &:first-child {
                margin-right: 20px;
            }
        }
    }

    /deep/ .ivu-scroll-loader {
        display: none;
    }

    /deep/ .ivu-card-body {
        width: 100%;
    }
